import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from './Components/Login From/Login';



function App() {
  return (
    <Router>
    <Routes>
      <Route path="/ " element={<Login />} />
      {/* <Route path="/registration" element={<Registra />} /> */}
    </Routes>
  </Router>
  );
};

export default App;
